import * as types from "./types";
import UserApi from "../../utils/UserApi"

const initialState = {

};

export default function errorReducer(state = initialState, {type, payload = null}) {
    switch (type) {
        case types.STEAM_LOGIN_COMPLETED:
            return {}
        default:
            return state;
    }
};
